import NewsletterForm from "../../components/NewsletterForm"
import Footer from "../../components/Footer"

export default function HomePage() {
  return (
    <div>
      <Header/>
      <Carousel/>
      <ProductsContainer/>
      <NewsletterForm/>
      <Footer/>
    </div>
  )
}
